package cn.wsgwz.basemodule

import cn.wsgwz.basemodule.utilities.LLog
import cn.wsgwz.basemodule.utilities.retrofit.okHttp.interceptors.LogInterceptor
import cn.wsgwz.basemodule.utilities.retrofit.converter.string.StringConverterFactory
import cn.wsgwz.basemodule.utilities.retrofit.gson.DoubleDefault0Adapter
import cn.wsgwz.basemodule.utilities.retrofit.gson.IntegerDefault0Adapter
import cn.wsgwz.basemodule.utilities.retrofit.gson.LongDefault0Adapter
import cn.wsgwz.basemodule.utilities.retrofit.okHttp.interceptors.HeaderInterceptor
import com.google.gson.Gson
import com.google.gson.GsonBuilder
import okhttp3.OkHttpClient
import retrofit2.Retrofit
import retrofit2.adapter.rxjava2.RxJava2CallAdapterFactory
import retrofit2.converter.gson.GsonConverterFactory

object BaseConst {
    private const val TAG = "BaseConst"
    const val NOTIFICATION_CHANNEL_ID = "1"


    object Action{
        const val USER_STATE_CHANGE = "cn.wsgwz.basemodule.USER_STATE_CHANGE"
    }
    object PrefKey {
        const val CURRENT_USER_ID = "current_user_id"
    }

    object Url {
        const val APK_DOWNLOAD_URL = "https://raw.githubusercontent.com/zhangweiqwe/DiDiHelper/master/app/release/app-release.apk"
        const val IMG_URL =
                "data:image/jpeg;base64,"
    }


    val FILE_PROVIDER = "${BaseApplication.getInstance().packageName}.provider".apply {
        LLog.d(TAG, this)
    }
    val GSON: Gson = GsonBuilder()
            .setPrettyPrinting()
            //.setDateFormat(SIMPLE_DATA_FORMAT)
            .registerTypeAdapter(Int::class.java, IntegerDefault0Adapter())
            .registerTypeAdapter(Double::class.java, DoubleDefault0Adapter())
            .registerTypeAdapter(Long::class.java, LongDefault0Adapter())
            .create()
    val OK_HTTP_CLIENT: OkHttpClient =
            OkHttpClient.Builder().addInterceptor(HeaderInterceptor())
                    .apply { if (BuildConfig.DEBUG) addInterceptor(LogInterceptor()) }.build()

    val RETROFIT: Retrofit = Retrofit.Builder()
            .client(OK_HTTP_CLIENT)
            //.baseUrl("http://192.168.1.100:8080/app_owner/")
            .baseUrl(BaseApplication.getInstance().baseUrl)
            .addConverterFactory(StringConverterFactory.create())
            .addConverterFactory(GsonConverterFactory.create(GSON))
            .addCallAdapterFactory(RxJava2CallAdapterFactory.create())
            .build()




}